import re
import base64
import lz4.frame
from Bio.Seq import Seq
from Bio.SeqRecord import SeqRecord
from Bio import SeqIO


def uncompress_sequence(sequence, name):

    sequence = re.sub("\n", "", sequence)
    decompressed_sequence = lz4.frame.decompress(base64.b64decode(sequence)).decode('utf-8')

    with open("{}.fasta".format(name), "w") as output_handle:
        SeqIO.write(SeqRecord(id=name, seq=Seq(decompressed_sequence)), output_handle, "fasta")


